import React from 'react';
import classes from "./Header.module.css";

const Header = () => {
    return (
        <header className={s.header}>
            <img src="https://www.freepnglogos.com/uploads/eagles-png-logo/eagle-sports-png-logos--0.png" />
        </header>
    );
}

export default Header;
